using System;
using System.Linq;
using Shouldly;
using System.Threading.Tasks;
using Volo.Abp.Domain.Repositories;
using Xunit;

namespace Resume.ResumeSkills
{
    public class ResumeSkillsAppServiceTests : ResumeApplicationTestBase
    {
        private readonly IResumeSkillsAppService _resumeSkillsAppService;
        private readonly IRepository<ResumeSkill, Guid> _resumeSkillRepository;

        public ResumeSkillsAppServiceTests()
        {
            _resumeSkillsAppService = GetRequiredService<IResumeSkillsAppService>();
            _resumeSkillRepository = GetRequiredService<IRepository<ResumeSkill, Guid>>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Act
            var result = await _resumeSkillsAppService.GetListAsync(new GetResumeSkillsInput());

            // Assert
            result.TotalCount.ShouldBe(2);
            result.Items.Count.ShouldBe(2);
            result.Items.Any(x => x.Id == Guid.Parse("b61993dd-2a9d-4053-8dc4-2cd38314d2d2")).ShouldBe(true);
            result.Items.Any(x => x.Id == Guid.Parse("00c1b91b-c51b-4672-9777-594f66d5aa3e")).ShouldBe(true);
        }

        [Fact]
        public async Task GetAsync()
        {
            // Act
            var result = await _resumeSkillsAppService.GetAsync(Guid.Parse("b61993dd-2a9d-4053-8dc4-2cd38314d2d2"));

            // Assert
            result.ShouldNotBeNull();
            result.Id.ShouldBe(Guid.Parse("b61993dd-2a9d-4053-8dc4-2cd38314d2d2"));
        }

        [Fact]
        public async Task CreateAsync()
        {
            // Arrange
            var input = new ResumeSkillCreateDto
            {
                ResumeMainId = Guid.Parse("bd4b6bda-7e14-4e2c-af16-1cf22a39e598"),
                ComputerSkills = "",
                ComputerSkillsEtc = "",
                ChineseTypingSpeed = 898132757,
                ChineseTypingCode = "fec056209b2e4adaaac368f57cf980707060071a040948f09a",
                EnglishTypingSpeed = 419865592,
                ProfessionalLicense = "",
                ProfessionalLicenseEtc = "",
                WorkSkills = "",
                WorkSkillsEtc = "",
                ExtendedInformation = "",
                DateA = new DateTime(2002, 7, 20),
                DateD = new DateTime(2006, 8, 26),
                Sort = 1840909927,
                Note = "",
                Status = "64c83013e49c4e728d7557d2c7cf5213f08f29e7d6d7499b96"
            };

            // Act
            var serviceResult = await _resumeSkillsAppService.CreateAsync(input);

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.ResumeMainId.ShouldBe(Guid.Parse("bd4b6bda-7e14-4e2c-af16-1cf22a39e598"));
            result.ComputerSkills.ShouldBe("");
            result.ComputerSkillsEtc.ShouldBe("");
            result.ChineseTypingSpeed.ShouldBe(898132757);
            result.ChineseTypingCode.ShouldBe("fec056209b2e4adaaac368f57cf980707060071a040948f09a");
            result.EnglishTypingSpeed.ShouldBe(419865592);
            result.ProfessionalLicense.ShouldBe("");
            result.ProfessionalLicenseEtc.ShouldBe("");
            result.WorkSkills.ShouldBe("");
            result.WorkSkillsEtc.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2002, 7, 20));
            result.DateD.ShouldBe(new DateTime(2006, 8, 26));
            result.Sort.ShouldBe(1840909927);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("64c83013e49c4e728d7557d2c7cf5213f08f29e7d6d7499b96");
        }

        [Fact]
        public async Task UpdateAsync()
        {
            // Arrange
            var input = new ResumeSkillUpdateDto()
            {
                ResumeMainId = Guid.Parse("612a5086-d1eb-40fb-a259-0b9d9484c947"),
                ComputerSkills = "",
                ComputerSkillsEtc = "",
                ChineseTypingSpeed = 606867628,
                ChineseTypingCode = "ba24f9cbaa52405198b76ad78afc4828567ab6914b394e3588",
                EnglishTypingSpeed = 2061423986,
                ProfessionalLicense = "",
                ProfessionalLicenseEtc = "",
                WorkSkills = "",
                WorkSkillsEtc = "",
                ExtendedInformation = "",
                DateA = new DateTime(2005, 3, 21),
                DateD = new DateTime(2018, 5, 23),
                Sort = 1715616913,
                Note = "",
                Status = "e7d3d5f8b88645759219ce617cd9213907bd20678bb04a6e8e"
            };

            // Act
            var serviceResult = await _resumeSkillsAppService.UpdateAsync(Guid.Parse("b61993dd-2a9d-4053-8dc4-2cd38314d2d2"), input);

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.ResumeMainId.ShouldBe(Guid.Parse("612a5086-d1eb-40fb-a259-0b9d9484c947"));
            result.ComputerSkills.ShouldBe("");
            result.ComputerSkillsEtc.ShouldBe("");
            result.ChineseTypingSpeed.ShouldBe(606867628);
            result.ChineseTypingCode.ShouldBe("ba24f9cbaa52405198b76ad78afc4828567ab6914b394e3588");
            result.EnglishTypingSpeed.ShouldBe(2061423986);
            result.ProfessionalLicense.ShouldBe("");
            result.ProfessionalLicenseEtc.ShouldBe("");
            result.WorkSkills.ShouldBe("");
            result.WorkSkillsEtc.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2005, 3, 21));
            result.DateD.ShouldBe(new DateTime(2018, 5, 23));
            result.Sort.ShouldBe(1715616913);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("e7d3d5f8b88645759219ce617cd9213907bd20678bb04a6e8e");
        }

        [Fact]
        public async Task DeleteAsync()
        {
            // Act
            await _resumeSkillsAppService.DeleteAsync(Guid.Parse("b61993dd-2a9d-4053-8dc4-2cd38314d2d2"));

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == Guid.Parse("b61993dd-2a9d-4053-8dc4-2cd38314d2d2"));

            result.ShouldBeNull();
        }
    }
}